import React from 'react';
import './app.scss'
import {requestumLogo} from "./constants/icons.constants";

export const App = () => {
    return (
        <div className='container'>
            <div className='header'>
                <div className='header-left'>
                    {requestumLogo}
                    <div className='header-left-title'>
                        <h1 className='company-name'>Requestum</h1>
                        <h2 className='company-description'>web development company</h2>
                    </div>
                </div>
                <div className='header-right'>
                    <h2 className='project-name'>Github users search app</h2>
                </div>
            </div>
        </div>
    )
}
